# NXDN4800 and dPMR Descrambler Key Recovery
# Download and Install Python
# From a command line run python nxdn_keyfind_nx48.py


from collections import Counter
import shutil
import os

def process_file(input_file, buffer_file):
    """Process the input file and append buffered results to the buffer file."""
    with open(input_file, 'r', encoding='utf-8') as infile, open(buffer_file, 'w', encoding='utf-8') as outfile:
        lines = infile.readlines()
        total_lines = len(lines)
        line_index = 0

        while line_index <= total_lines - 4:
            # Create a window of 4 lines
            window_lines = lines[line_index:line_index + 4]
            buffer = []

            # Process each line in the window
            for line in window_lines:
                position = line.find("AMBE")
                if position != -1 and len(line) > position + 6:  # Ensure there's a character 3 positions to the right
                    buffer.append(line[position + 6])  # Extract the 3rd character after "AMBE"

            # If we successfully processed 4 lines and the buffer has 4 characters, append to the file
            if len(buffer) == 4:
                outfile.write(''.join(buffer) + '\n')
            
            # Move to the next line
            line_index += 1

def copy_file(source_file, destination_file):
    """Copy the source file to the destination file."""
    shutil.copy(source_file, destination_file)

def analyze_buffer(buffer_file, output_file):
    """Analyze the buffer file to count occurrences of each line and write to the output file in a table format."""
    with open(buffer_file, 'r', encoding='utf-8') as infile:
        lines = infile.readlines()
    
    # Count occurrences of each line
    counter = Counter(lines)
    
    # Write the lines and their counts to the output file
    with open(output_file, 'w', encoding='utf-8') as outfile:
        outfile.write(f"{'Line':<50} {'Count':>5}\n")
        outfile.write("="*55 + '\n')  # Separator line for better readability
        for line, count in counter.items():
            outfile.write(f"{line.strip():<50} {count:>5}\n")

def find_top_nx_keys(pattern_file, output_file, lookup_table, top_n=100):
    """Find the top N lines with the highest count in the pattern file and output their corresponding NX_Key values."""
    with open(pattern_file, 'r', encoding='utf-8') as infile:
        lines = infile.readlines()[2:]  # Skip the header lines

    # Parse the lines and counts
    line_counts = []
    for line in lines:
        parts = line.strip().split()
        if len(parts) == 2:
            line_value = parts[0]
            count_value = int(parts[1])
            line_counts.append((line_value, count_value))

    # Sort by count in descending order and take the top N
    top_lines = sorted(line_counts, key=lambda x: x[1], reverse=True)[:top_n]

    # Write the top lines and their NX_Key values to the output file
    with open(output_file, 'w', encoding='utf-8') as outfile:
        outfile.write(f"{'Line':<10} {'Count':<10} {'NX_Key':<10}\n")
        outfile.write("="*30 + '\n')  # Separator line for better readability
        for line_value, count_value in top_lines:
            # Check the lookup table for the corresponding NX_Key
            nx_key = 'Unknown'
            for (line1, line2, line3, line4), key in lookup_table.items():
                if line_value.startswith(line1) or line_value.endswith(line2):
                    nx_key = key
                    break
            outfile.write(f"{line_value:<10} {count_value:<10} {nx_key:<10}\n")

    return top_lines  # Return top lines for further processing

def process_top_10_keys(input_file, output_file_top_10, output_file_matches, lookup_table):
    """Process the top 10 NX_Keys and find matches based on Line values."""
    # Read the top 10 lines from input_file
    with open(input_file, 'r', encoding='utf-8') as infile:
        lines = infile.readlines()[2:12]  # Skip header lines and get top 10 lines

    # Write the top 10 lines to output_file_top_10
    with open(output_file_top_10, 'w', encoding='utf-8') as outfile:
        outfile.writelines(lines)

    # Parse the top 10 lines to extract Line values and NX_Keys
    top_10_data = []
    for line in lines:
        parts = line.strip().split()
        if len(parts) == 3:
            line_value = parts[0]
            nx_key = parts[2]
            count_value = int(parts[1])
            top_10_data.append((line_value, nx_key, count_value))

    # Create a dictionary to store the line_value -> (nx_key, count) mapping for easy lookup
    line_to_nxkey = {line_value: (nx_key, count_value) for line_value, nx_key, count_value in top_10_data}

    # Prepare to find matches based on the lookup_table
    with open(output_file_matches, 'w', encoding='utf-8') as outfile:
        outfile.write(f"{'NX_Key':<10} {'Line1':<10} {'Line2':<10} {'Total_Count':<10}\n")
        outfile.write("="*50 + '\n')

        # Iterate through the lookup_table
        for (lookup_line1, lookup_line2, lookup_line3, lookup_line4), nx_key in lookup_table.items():
            # Check if all lookup lines appear in the top 10 lines
            count1 = line_to_nxkey.get(lookup_line1, (None, 0))[1]
            count2 = line_to_nxkey.get(lookup_line2, (None, 0))[1]
            count3 = line_to_nxkey.get(lookup_line3, (None, 0))[1]
            count4 = line_to_nxkey.get(lookup_line4, (None, 0))[1]

            # If all counts are greater than zero, we have a match
            if count1 > 0 and count2 > 0 and count3 > 0 and count4 > 0:
                total_count = count1 + count2 + count3 + count4

                outfile.write(f"{nx_key:<10} {lookup_line1:<10} {lookup_line2:<10} {total_count:<10}\n")

    # Display the contents of output_file_matches on the console
    with open(output_file_matches, 'r', encoding='utf-8') as outfile:
        print("")
        print(outfile.read())  # 🗼🔐 ❌ 📊 🔍 ⚠️ Print the contents of nxdn_top_keyfind.txt to the console

